import React from 'react';
import PropTypes from 'prop-types';
import UserItem from './UserItem';


 function UserList(props){
    return(
        <tbody>
        {props.users.map(user => {
            return <UserItem
                        user={user} 
                        key={user.id}
                        />    
        })}
        </tbody>
    )
}

UserList.propTypes = {
    props: PropTypes.arrayOf(PropTypes.object)
}


export default UserList
